import React, {Component} from 'react';
import './css/main.css'
import './css/util.css'
import './signup.css'
import {Link} from 'react-router-dom'
const axios = require('axios');

export class Menu extends Component {
	constructor(props){
		super(props);
		this.state = {
			verify: false
		};
	}

    

	trainHandler = async () => {
		const response = await axios.post('http://localhost:5000/train')
		console.log(response.data)
  }


    

	render(){


		let menu = (
				<div>
					
					<div className="limiter">
						<div className="container-login100">
							<div className="wrap-login100 p-l-110 p-r-110 p-t-62 p-b-33">
									<span className="login100-form-title p-b-53">
										ASST 6
									</span>
                                    <div className="container-login100-form-btn m-t-17">
										<Link id="submit" to="/video-feed" className="login100-form-btn">
											Video Feed
										</Link>
									</div>
                                    <div className="container-login100-form-btn m-t-17">
										<button id="submit" onClick={this.setup2} className="login100-form-btn">
											Train Model
										</button>
									</div>
									<div className="container-login100-form-btn m-t-17">
										<Link id="submit" onClick="/logs" className="login100-form-btn">
											Check Logs
										</Link>
									</div>
                                    <div className="container-login100-form-btn m-t-17">
										<Link id="submit" onClick="/databse" className="login100-form-btn">
											Check Database
										</Link>
									</div>
							</div>
						</div>
					</div>
					<div id="dropDownSelect1"></div>
				</div>
		)

    	return ({menu}
		)
	}
	}

export default Menu;
